Originally opening under the name of liberty theater in 1918. It was designed by architect C. Howard Crane with Stanley & Scheibel as associates architects. It was equipped with a pipe organ and know as "small, yet elegant." On July 19th of 1929 it became known as the Paramount Theater along with a showing of 4 Marx Brothers in ‚ÄúThe Cocoanuts‚Äù. And was given it's art deco make over in 1930. It closws in 1976 with Bill Cosby's "let's do it again". The final straw was a failed attempted to renovate the theater in 1980, which ultimately left it abandoned.

Upon my visit there a local hanging out in one of the rooms above where the marquee used to hang said "hey!" And waved out the window to me. As he caught my attention he let me know that the entrance was on the side street by the alley. Gotta love friendly locals.. The whole town had this relaxed feel as if sneaking around and exploring abandoned buildings was welcomed. 

Eventually, the Paramount theater was torn down in March of 2013, where a parking lot sits in its place. A small piece of the facade remains as a reminder to a time when things were a bit more glamorous.";}i:82;a:1:{s:14:"comments_count";i:3;}i:83;a:1:{s:11:"likes_count";i:33;}i:84;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEusuKRABiv";}i:85;a:1:{s:5:"image";s:250:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118775457_1206053979763865_7309408857956424540_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=ik_gFlZJxEEAX--sXfV&oh=ff66c0d2bf49dfd194e9534708a9b99a&oe=5F7A451A";}i:86;a:1:{s:4:"type";s:7:"sidecar";}i:87;a:1:{s:8:"owner_id";i:175577629;}i:88;a:1:{s:14:"owner_username";s:0:"";}i:89;a:1:{s:14:"owner_fullname";s:0:"";}i:90;a:1:{s:9:"owner_pic";s:0:"";}i:91;a:1:{s:2:"id";s:19:"2391045098197547086";}i:92;a:1:{s:10:"short_code";s:11:"CEustk4APhO";}i:93;a:1:{s:12:"created_time";i:1599254809;}i:94;a:1:{s:7:"caption";s:772:"üèúÔ∏è
